import React from 'react';
import './OrgUnitDetails.scss';
import PropTypes from 'prop-types';
import DataCards from '../DataCards/DataCards';
import { getOrgUnitsNext, getOrgUnits } from '../../utils/utils';
// import { connect } from 'react-redux';
// import { withRouter } from 'react-router-dom';
const OrgUnitDetails = (props)=>{
    // {"id":4,"name":"MobIux","location":"Bengaluru","parent":null,"child":[{"id":14,"name":"Childred","location":null,"has_children":true}]}
    const { Data, bodyHandler } = props;
    const {location, parent, child} = Data;
    const cardData = getOrgUnits(child);

    return (
        <div>
            <div>
                <span className="text-capitalize">location</span>
                <span className="">:</span>
                <span className="text-capitalize">{location}</span>
            </div>
            <div>
                <span className="text-capitalize">parent</span>
                <span className="">:</span>
                <span className="text-capitalize">{parent? parent: '-'}</span>
            </div>
            <div>
                <DataCards {...props} data={cardData} actions={bodyHandler} />
            </div>
        </div>
    )
}

